PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "account_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "account_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "account_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "account_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "account_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "account_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "administration_application" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "title" varchar(100) NOT NULL, "description" text NOT NULL, "url" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "administration_common" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "title" varchar(100) NOT NULL, "description" text NOT NULL, "district" varchar(80) NOT NULL);
CREATE TABLE IF NOT EXISTS "administration_fokotany" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "date_created" date NOT NULL, "date_modificated" date NOT NULL);
CREATE TABLE IF NOT EXISTS "administration_sector" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "date_created" date NOT NULL, "date_modificated" date NOT NULL, "fokotany_id" bigint NOT NULL REFERENCES "administration_fokotany" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "administration_staff" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "last_name" varchar(100) NOT NULL, "first_name" varchar(100) NOT NULL, "gender" varchar(1) NOT NULL, "birthday" datetime NOT NULL, "contact_1" varchar(10) NOT NULL, "contact_2" varchar(10) NULL, "email" varchar(254) NULL, "date_joined_last_role" date NULL, "date_stoped_last_role" date NULL, "date_joined" date NOT NULL, "date_fired" date NULL, "date_modificated" date NOT NULL, "is_active" bool NOT NULL, "is_fired" bool NOT NULL, "last_role_id" bigint NULL REFERENCES "administration_role" ("id") DEFERRABLE INITIALLY DEFERRED, "role_id" bigint NULL REFERENCES "administration_role" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_staff" UNIQUE ("last_name", "first_name", "gender", "birthday"));
CREATE TABLE IF NOT EXISTS "administration_role" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL UNIQUE, "title" varchar(100) NOT NULL UNIQUE, "description" text NOT NULL, "access_id" bigint NULL REFERENCES "account_user" ("id") DEFERRABLE INITIALLY DEFERRED, "app_id" bigint NULL REFERENCES "administration_application" ("id") DEFERRABLE INITIALLY DEFERRED, "service_id" bigint NOT NULL REFERENCES "administration_service" ("id") DEFERRABLE INITIALLY DEFERRED, "date_created" date NOT NULL, "date_modificated" date NOT NULL, "grade" integer NOT NULL, CONSTRAINT "unique_role" UNIQUE ("name", "access_id", "service_id"));
CREATE TABLE IF NOT EXISTS "administration_service" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "title" varchar(100) NOT NULL, "description" text NOT NULL, "grade" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "civil_marriagecertificate" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "wedding_day" datetime NOT NULL, "is_active" bool NOT NULL, "date_register" datetime NOT NULL, "date_created" datetime NOT NULL, "date_modified" datetime NOT NULL, "fokotany_id" bigint NOT NULL REFERENCES "administration_fokotany" ("id") DEFERRABLE INITIALLY DEFERRED, "responsible_staff_id" bigint NOT NULL REFERENCES "administration_staff" ("id") DEFERRABLE INITIALLY DEFERRED, "bride_id" bigint NOT NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "groom_id" bigint NOT NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_marriage_certificate" UNIQUE ("groom_id", "bride_id", "wedding_day"));
CREATE TABLE IF NOT EXISTS "finances_serviceprice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "certificate_price" real NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "civil_birthcertificatedocument" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "father_carreer" varchar(80) NULL, "father_address" varchar(100) NULL, "mother_carreer" varchar(80) NOT NULL, "mother_address" varchar(100) NOT NULL, "declarer_carreer" varchar(80) NOT NULL, "declarer_address" varchar(100) NOT NULL, "was_alive" bool NOT NULL, "date_register" datetime NULL, "date_created" datetime NOT NULL, "date_modified" datetime NOT NULL, "date_validated" datetime NULL, "status" varchar(1) NOT NULL, "notes" text NULL, "price" real NOT NULL, "num_copy" integer NOT NULL, "father_id" bigint NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "certificate_id" bigint NOT NULL REFERENCES "civil_birthcertificate" ("id") DEFERRABLE INITIALLY DEFERRED, "client_detail" varchar(120) NULL, "validated_by_id" bigint NULL REFERENCES "administration_staff" ("id") DEFERRABLE INITIALLY DEFERRED, "date_recognization" datetime NULL);
CREATE TABLE IF NOT EXISTS "civil_deathcertificatedocument" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status" varchar(1) NOT NULL, "notes" text NULL, "price" real NOT NULL, "num_copy" integer NOT NULL, "certificate_id" bigint NOT NULL REFERENCES "civil_deathcertificate" ("id") DEFERRABLE INITIALLY DEFERRED, "date_validated" datetime NULL, "validated_by_id" bigint NULL REFERENCES "administration_staff" ("id") DEFERRABLE INITIALLY DEFERRED, "date_created" datetime NOT NULL, "date_modified" datetime NOT NULL, "date_register" datetime NULL);
CREATE TABLE IF NOT EXISTS "civil_deathcertificate" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "death_day" datetime NOT NULL, "death_place" varchar(100) NOT NULL, "dead_carreer" varchar(80) NULL, "dead_address" varchar(100) NULL, "father_full_name" varchar(120) NULL, "father_is_alive" bool NULL, "mother_full_name" varchar(120) NULL, "mother_is_alive" bool NULL, "declarer_relationship" varchar(80) NOT NULL, "declarer_was_present" bool NOT NULL, "declarer_carreer" varchar(80) NOT NULL, "declarer_address" varchar(100) NOT NULL, "date_declaration" datetime NOT NULL, "date_created" datetime NOT NULL, "date_modified" datetime NOT NULL, "fokotany_id" bigint NOT NULL REFERENCES "administration_fokotany" ("id") DEFERRABLE INITIALLY DEFERRED, "responsible_staff_id" bigint NOT NULL REFERENCES "administration_staff" ("id") DEFERRABLE INITIALLY DEFERRED, "dead_id" bigint NOT NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "declarer_id" bigint NOT NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "was_born" bool NOT NULL, "father_id" bigint NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "mother_id" bigint NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "date_register" datetime NULL, "number" integer NOT NULL, CONSTRAINT "unique_death_certificate" UNIQUE ("dead_id", "declarer_id", "responsible_staff_id", "fokotany_id"));
CREATE TABLE IF NOT EXISTS "events_event" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "description" text NOT NULL, "date_event" date NOT NULL, "date_created" date NOT NULL, "date_modified" date NOT NULL);
CREATE TABLE IF NOT EXISTS "events_commerceevent" ("event_ptr_id" bigint NOT NULL PRIMARY KEY REFERENCES "events_event" ("id") DEFERRABLE INITIALLY DEFERRED, "marchand" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "civil_birthcertificate" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "number" integer NOT NULL, "father_carreer" varchar(80) NULL, "father_address" varchar(100) NULL, "mother_carreer" varchar(80) NOT NULL, "mother_address" varchar(100) NOT NULL, "declarer_relationship" varchar(80) NOT NULL, "declarer_carreer" varchar(80) NOT NULL, "declarer_address" varchar(100) NOT NULL, "declarer_was_present" bool NOT NULL, "responsible_staff_name" varchar(100) NOT NULL, "responsible_staff_role" varchar(100) NOT NULL, "certificate_type" varchar(1) NOT NULL, "was_alive" bool NOT NULL, "date_declaration" datetime NOT NULL, "date_register" datetime NULL, "date_recognization" datetime NULL, "date_created" datetime NOT NULL, "date_modified" datetime NOT NULL, "fokotany_id" bigint NOT NULL REFERENCES "administration_fokotany" ("id") DEFERRABLE INITIALLY DEFERRED, "responsible_staff_id" bigint NOT NULL REFERENCES "administration_staff" ("id") DEFERRABLE INITIALLY DEFERRED, "born_id" bigint NOT NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "declarer_id" bigint NOT NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "father_id" bigint NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, "mother_id" bigint NOT NULL REFERENCES "civil_person" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_birth_certificate" UNIQUE ("born_id", "father_id", "mother_id", "declarer_id"));
CREATE TABLE IF NOT EXISTS "civil_person" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "last_name" varchar(100) NOT NULL, "first_name" varchar(100) NOT NULL, "gender" varchar(1) NOT NULL, "birth_place" varchar(100) NULL, "is_alive" bool NOT NULL, "is_parent" bool NOT NULL, "is_married" bool NOT NULL, "birthday" datetime NULL, CONSTRAINT "person_unique" UNIQUE ("first_name", "last_name", "gender", "birthday"));
